import { useParams } from 'react-router-dom';

const ProductDetail = (props) => {
    const params = useParams();

    return (
        <>
            <h1>Product Detail</h1>
            <p>{params.productId}</p>
            <p><Link to=".." relative='path'>Back</Link></p>
        </>
    )
};

export default ProductDetail;
